(998, 'test', NULL, 'list_rec = fun_mysql( \\\r\n    "\\\r\n        SELECT \\\r\n\t\t    id, \\\r\n\t\t\taddress, \\\r\n\t\t\tST_AsGeoJSON(PointFromText(CONCAT(''POINT('',lon,'' '',lat,'')''),1)) AS location \\\r\n        FROM point_top \\\r\n    ", \\\r\n    False, \\\r\n\tTrue \\\r\n)\r\nret = fun_point_fc(list_rec)\r\n', 'Тестовый скрипт', True, NULL),
(999, 'test_arj', NULL, 'ret = fun_rec_top_get(''geometry'', '''', [''id'', ''category'', ''name''])\r\n\r\n\r\nprint(''!!!!!'', k)\r\n\r\n# IF\r\nif id1>=(8-id2): \\\r\n    id3=3; \\\r\n\tprint(id1*id2);\r\n\r\n# MATH\r\nid3=3.2\r\nprint(id2+2*3-1)\r\nid1=(8-id2)\t\r\nd = False\r\nm = not s and d\r\nk = [87, ''kkk'', True, False, True]\r\ns = k[key][2]\r\n\r\n# MYSQL\r\ndat = fun_mysql("SELECT id, address FROM point_top WHERE id="+"4"+"5") \r\ndat = fun_mysql( \\\r\n    "\\\r\n        SELECT \\\r\n\t\t    id, \\\r\n\t\t\taddress, \\\r\n\t\t\tST_AsGeoJSON(PointFromText(CONCAT(''POINT('',lon,'' '',lat,'')''),1)) AS location \\\r\n        FROM point_top" \\\r\n)\r\n\r\n# ID связанных записей\r\ndat = fun_mysql("\\\r\n    SELECT \\\r\n        rel_dop.id \\\r\n    FROM \\\r\n        rel_top INNER JOIN rel_dop USING(id) \\\r\n    WHERE \\\r\n        rel_top.key_id=key_id AND \\\r\n        rel_dop.obj_id=obj_id \\\r\n")\r\nret = points_to_features(dat)\r\n\r\n\r\n#######################################\r\nlist_rec = fun_mysql( \\\r\n    "\\\r\n        SELECT \\\r\n\t\t    id, \\\r\n\t\t\taddress, \\\r\n\t\t\tST_AsGeoJSON(PointFromText(CONCAT(''POINT('',lon,'' '',lat,'')''),1)) AS location \\\r\n        FROM point_top \\\r\n    ", \\\r\n    False, \\\r\n\tTrue \\\r\n)\r\nret = fun_point_fc(list_rec)\r\n#######################################', 'Примеры скриптов', True, NULL);
